import React from 'react'
import { useEffect } from 'react'

const useCustomHook = (count) => {
    useEffect(()=>{
        if(count>=1){
            document.title = `chat(${count})`
        }
        else{
            document.title = 'chat'
        }
    },[count])
}

export default useCustomHook
